import React from "react";

class Home extends React.Component {
  constructor(props) {
    super(props);
    this.state = { date: new Date() };
  }
  render() {
    return (
      <div>
        <form>
          <select>
            <option>CJ대한통운</option>
          </select>
          <input type="text" />
          <button className="button">확 인</button>
        </form>
      </div>
    );
  }
}
export default Home;
